import { Link } from 'react-router-dom';
import background from '../2593'

     
  


const Landing = () => {
    return (
        <section style={{ backgroundImage:`url(${background})`,
        backgroundRepeat: 'no-repeat',
        backgroundSize:"cover",
        height:'100vh',
        backgroundPosition: 'center'}} className="container">
    <header>
      <h2 style={{fontSize:"40px"}} className=" rounded logo text-dark mt-3 badge badge-danger">Dimestore</h2>
    
    </header>
  
        

    <div className="overlay"></div>
    <div className="text mt-5">
      <h2 style={{fontSize:'50px'}} className="rounded text-dark "> Your most unhappy customers are your most important source of learning‚Äù </h2> 
    
       
      
    </div>
    <div>
         <Link to='/home' className=" text-dark btn btn-warning rounded" >Shop Now</Link>
    </div>
   </section>
      );
}
 
export default Landing;
